import Image from "./Image";


function Projects(){
    return(
        <section id="projects" className="colored-section">
            <div className="container-fluid">
            <Image src="images/iphone6.png" alt="iphone" className="prjImg1" />
            <Image src="images/flowers.jpg" alt="flowers" className="prjImg2" />
            <Image src="images/flowers.jpg" alt="flowers" className="prjImg3" />
            <Image src="images/flowers.jpg" alt="flowers" className="prjImg4" />
            <Image src="images/flowers.jpg" alt="flowers" className="prjImg5" />
            <Image src="images/flowers.jpg" alt="flowers" className="prjImg6" />
            <Image src="images/flowers.jpg" alt="flowers" className="prjImg7" />
            </div>
        </section>


    )
}


export default Projects;
